Templates = ({"first_steps":{"overview":"<div class='first_steps'>\n<h2>Your first steps in Teambox</h2>\n<div class='steps'>\n<img alt=\"1-disabled\" data-name=\"first_project\" data-step=\"1\" src=\"/images/badges/1-disabled.jpg?1335691961\" />\n<img alt=\"5-disabled\" data-name=\"first_invite\" data-step=\"5\" src=\"/images/badges/5-disabled.jpg?1335691961\" />\n<img alt=\"2-disabled\" data-name=\"first_conversation\" data-step=\"2\" src=\"/images/badges/2-disabled.jpg?1335691961\" />\n<img alt=\"3-disabled\" data-name=\"first_task\" data-step=\"3\" src=\"/images/badges/3-disabled.jpg?1335691961\" />\n<img alt=\"4-disabled\" data-name=\"first_page\" data-step=\"4\" src=\"/images/badges/4-disabled.jpg?1335691961\" />\n</div>\n<div class='step step1' style='display: none'>\n<h3>Create your first project</h3>\n<p>Congratulations! You're our newest user.</p>\n<p>It's time to create your first project and get things done.</p>\n<p>To create a project, click on \"New Project\" in the sidebar.</p>\n</div>\n<div class='step step1-complete' style='display: none'>\n<h3>You already have your first project</h3>\n<p>You can create more projects at any time!</p>\n</div>\n<div class='step step2' style='display: none'>\n<h3>Post your first conversation</h3>\n<p>It's time to communicate with your team.</p>\n<p>\nIn Teambox you can post a comment on any project\nand your colleagues can read and reply.\n</p>\n<p>Create a conversation in a project from your Recent Activity or Conversations.</p>\n</div>\n<div class='step step2-complete' style='display: none'>\n<h3>You already created your first conversation</h3>\n<p>Use conversations to discuss anything, anytime, with your team.</p>\n</div>\n<div class='step step3' style='display: none'>\n<h3>Create your first task</h3>\n<p>\nYou can create tasks for yourself and anyone on your team.\nTasks include due dates, time tracking and commenting.\n</p>\n<p>Select tasks from any project and create a task list to get started.</p>\n</div>\n<div class='step step3-complete' style='display: none'>\n<h3>You already created some tasks</h3>\n<p>Use tasks to keep track of what needs to be done and focus on what you need to do next.</p>\n</div>\n<div class='step step4' style='display: none'>\n<h3>Create your first page</h3>\n<p>Each project has a space to document and share. It's called Pages, and you can build as many as you need.</p>\n<p>Share reference information, phone numbers, notes, proposals.</p>\n<p>Get started by going to a project's pages and creating one.</p>\n</div>\n<div class='step step4-complete' style='display: none'>\n<h3>You already created a Page</h3>\n<p>Use pages from now on to share and collaborate over reference information.</p>\n</div>\n<div class='step step5' style='display: none'>\n<h3>Invite your team to your projects</h3>\n<p>It's easy to invite your whole team to your projects.</p>\n<p>You can create projects for each workgroup: Finance, Development, sub-contractors, client projects, etc.</p>\n<p>To invite users, click on the project in the sidebar, go to People and enter your team member's emails.</p>\n</div>\n<div class='step step5-complete' style='display: none'>\n<h3>Your first invites have been sent</h3>\n<p>Only people you grant access will be able to access your projects.</p>\n</div>\n<div class='step completed'>\n<h3>Initiation complete!</h3>\n<p>You have completed all your first steps. For more tips, click on the little light bulb next to your user name at the top of the screen.</p>\n<p>\n<a href='http://twitter.com/teambox_app' target='_blank'>Follow us on Twitter</a>\n</p>\n<p>\n<a class='close_first_steps' href='#'>\n[ Close this first steps guide ]\n</a>\n</p>\n</div>\n</div>\n","progress_bar":"<div class='completion'>\n{{text}}\n<div class='progressbar thin orange' style='width: {{width}}px'>\n<div class='bar1' style='width: {{filled}}px'></div>\n<div class='bar2' style='width: {{filled}}px'></div>\n<div class='bar3' style='width: {{filled}}px'></div>\n</div>\n</div>\n"},"projects":{"overlay":"{{#project}}\n<div class='overlay'>\n<p class='title'>\n<a href='/projects/{{permalink}}'>\n{{name}}\n</a>\n</p>\n<div class='sections'>\n<p>\n<a class='recent_activity' href='/projects/{{permalink}}'>\nRecent activity\n</a>\n</p>\n<p>\n<a class='conversations' href='/projects/{{permalink}}/conversations'>\nConversations\n</a>\n</p>\n<p>\n<a class='tasks' href='/projects/{{permalink}}/task_lists'>\nTasks\n</a>\n</p>\n<p>\n<a class='pages' href='/projects/{{permalink}}/pages'>\nPages\n</a>\n</p>\n<p>\n<a class='files' href='/projects/{{permalink}}/uploads'>\nFiles\n</a>\n</p>\n<p>\n<a class='people' href='/projects/{{permalink}}/people'>\nPeople & Permissions\n</a>\n</p>\n</div>\n</div>\n{{/project}}\n","index":"<h2>\u79c1\u306e\u30d7\u30ed\u30b8\u30a7\u30af\u30c8</h2>\n<div class='projects_pane'>\n{{#organizations}}\n<h4>\n<a href='/organizations/{{permalink}}'>\n{{name}}\n</a>\n</h4>\n<div class='projects'>\n{{#active_projects}}\n<p class='project'>\n<a href='/projects/{{permalink}}'>\n{{name}}\n</a>\n<span class='status'>\n{{my_role}}\n{{#admin}}\n<a href='/projects/{{permalink}}/settings'>\n(\u30bb\u30c3\u30c6\u30a3\u30f3\u30b0)\n</a>\n{{/admin}}\n</span>\n</p>\n{{/active_projects}}\n{{^active_projects}}\n<p class='none'>\u3053\u306e\u7d44\u7e54\u306b\u306f\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u306f\u5b58\u5728\u3057\u307e\u305b\u3093\u3002</p>\n{{/active_projects}}\n{{#has_archived_projects}}\n<p>\n<a class='show_archived' href='#'>\nShow {{count}} archived projects\n</a>\n</p>\n<div class='archived_projects' style='display: none'>\n{{#projects}}\n<p class='project'>\n<a href='/projects/{{permalink}}'>\n{{name}}\n</a>\n</p>\n{{/projects}}\n</div>\n{{/has_archived_projects}}\n</div>\n{{/organizations}}\n<p>\n<a class='closePane' href='#'>Close projects view</a>\n</p>\n</div>\n"},"search":{"results":"<p>Found {{length}} results</p>\n<div id='results'>\n{{#objects}}\n<div class='result'>\n<div class='{{icon_class}}'></div>\n{{#project}}\n<a href='/projects/{{permalink}}'>\n{{name}}\n</a>\n{{/project}}\n&rarr;\n<a href='{{link}}'>\n{{name}}\n</a>\n<span class='time'>\n{{timeago}}\n</span>\n</div>\n{{/objects}}\n</div>\n","loading":"<h2>\nResults for <strong>{{query}}</strong>\n</h2>\n<div id='search_results'>\n<p class='loading'>\n<img src='/images/loading.gif' />\nLoading...\n</p>\n</div>\n<div class='pagination_links' style='display:none'>\nShowing results from: \n<ol class='pages'></ol>\n</div>\n<p>\n<a class='closePane' href='#'>Close search results</a>\n</p>\n"},"task_list_templates":{"template":"<div class='task_list_templates' data-id='{{id}}' data-organization='{{organization}}' id='task_list_template_{{id}}'>\n<div class='data'>\n<div class='actions'>\n<a class='trash_icon' href='#'></a>\n<a class='edit_icon' href='#'></a>\n</div>\n<img alt=\"Drag\" class=\"drag\" src=\"/images/drag.png?1335691961\" />\n<span class='name'>{{name}}</span>\n<ul>\n{{#tasks}}\n<li>\nTask:\n<span class='title'>{{title}}</span>\n<div class='desc'>{{desc}}</div>\n</li>\n{{/tasks}}\n</ul>\n</div>\n</div>\n","form_task":"<li>\n<div class='text_field'>\n<img alt=\"Drag\" class=\"drag\" src=\"/images/drag.png?1335691961\" />\n<input name='task_list_template[titles][]' placeholder='Task name' type='text' value='{{title}}' />\n<input name='task_list_template[descs][]' placeholder='Description' type='text' value='{{desc}}' />\n</div>\n</li>\n","form":"<form action='{{path}}' class='{{action}}_task_list_template task_list_template_form app_form' data-remote='true' method='post'>\n<h3>Task List Template</h3>\n<p>A task list template is a set of common tasks you can repeatedly create task lists from.</p>\n<input name='_method' type='hidden' value='{{verb}}' />\n<div class='name text_field'>\n<label for='task_list_template[name]'>\nTemplate name <i>eg. Design process</i>\n</label>\n<input name='task_list_template[name]' type='text' value='{{name}}' />\n</div>\n<h4>Tasks</h4>\n<ul id='template_tasks'>\n{{#tasks}}\n<li>\n<div class='text_field'>\n<img alt=\"Drag\" class=\"drag\" src=\"/images/drag.png?1335691961\" />\n<input name='task_list_template[titles][]' placeholder='Task name' type='text' value='{{title}}' />\n<input name='task_list_template[descs][]' placeholder='Description' type='text' value='{{desc}}' />\n</div>\n</li>\n{{/tasks}}\n</ul>\n<input data-disable-with='Saving' type='submit' value='\u6295\u7a3f' />\n<a class='cancel' href='#'>\u30ad\u30e3\u30f3\u30bb\u30eb</a>\n</form>\n"},"comments":{"private_box":"<div class='option normal'>\n<input disabled='true' id='{{object_prefix}}_public' name='{{object_type}}[is_private]' type='radio' value='false' />\n<label for='{{object_prefix}}_public'>{{is_public}}</label>\n</div>\n<div class='option private'>\n<input disabled='true' id='{{object_prefix}}_private' name='{{object_type}}[is_private]' type='radio' value='true' />\n<label for='{{object_prefix}}_private'>{{is_private}}</label>\n</div>\n","private_box_readonly":"<div class='option normal'>\n<label>{{is_public}}</label>\n</div>\n<div class='option private'>\n<label>{{is_private}}</label>\n</div>\n"},"tasks":{"my_task":"<div class='el task {{task_classes}}' id='my_task_{{task_id}}'>\n<a href='{{task_url}}'>{{task_name}}</a>\n<span class='due_on'>{{task_due}}</span>\n</div>\n","calendar_date_select_urgent_header":"<div class='urgent'>\n<input class='urgent' id='task_{{task_id}}_urgent' type='checkbox' value='1' />\n<label for='task_{{task_id}}_urgent'>\nUrgent, to be done as soon as possible\n</label>\n<a class='show-help text_actions' href='#'>[?]</a>\n<div class='help' style='display: none'>\nWill show up on \"tasks due for today\" for the assigned user\n</div>\n</div>\n"},"uploads":{"move":"<h2>\nMove to another folder\n</h2>\n<form action='{{path}}' id='move_form' method='put' remote='true'>\n<input name='moveable_type' type='hidden' value='{{moveable_type}}' />\n<input name='moveable' type='hidden' value='{{moveable}}' />\n<div class='full_row'>\n<select id='target_folder_id' name='target_folder_id'>\n{{#folders}}\n<option value='{{id}}'>\n{{name}}\n</option>\n{{/folders}}\n</select>\n</div>\n</form>\n"},"badges":{"first_project":"<div class='overlay_badge'>\n<img src='/images/badges/1.jpg' />\n<div class='text'>\n<h2>Let's get started!</h2>\n<p>\nYour first project is ready. Projects are a shared space for discussions, tasks and files.\n</p>\n<p>\nNext, invite users and start collaborating.\n</p>\n</div>\n<div class='clear'></div>\n</div>\n","first_conversation":"<div class='overlay_badge'>\n<img src='/images/badges/2.jpg' />\n<div class='text'>\n<h2>Your first Conversation!</h2>\n<p>\nThis is your first step in the way to better team communication.\nConversations are the best way to discuss with your team.\n</p>\n<p>\nUse conversations as a smart replacement of emails: faster and more transparent.\n</p>\n</div>\n<div class='clear'></div>\n</div>\n","first_page":"<div class='overlay_badge'>\n<img src='/images/badges/4.jpg' />\n<div class='text'>\n<h2>Your first Page!</h2>\n<p>\nA <strong>shared place</strong> to post important notes for your team.\n</p>\n<p>\nUse pages to keep your information in one place: documents, reference, etc.\n</p>\n</div>\n<div class='clear'></div>\n</div>\n","first_task":"<div class='overlay_badge'>\n<img src='/images/badges/3.jpg' />\n<div class='text'>\n<h2>Your first Task!</h2>\n<p>\n<strong>Keep track</strong> of what needs to be done and delegate tasks to your team.\n</p>\n<p>\nStay on top of your tasks inside each Project. You'll never miss a deadline!\n</p>\n</div>\n<div class='clear'></div>\n</div>\n","first_invite":"<div class='overlay_badge'>\n<img src='/images/badges/5.jpg' />\n<div class='text'>\n<h2>Invitations sent!</h2>\n<p>\nYou just sent your contacts an email to join your project.\nTeambox is private and secure and only project members can see your content.\n</p>\n<p>\nTip: Create a project for each workgroup you're involved with,\nand send each member an invitation.\n</p>\n</div>\n<div class='clear'></div>\n</div>\n"},"navigation":{"project":"{{#projects}}\n<div class='el'>\n<a class='project' href='/projects/{{permalink}}'>{{name}}</a>\n</div>\n<div class='contained'>\n<div class='el'>\n<a class='recent_activity ajax' href='/projects/{{permalink}}'>Recent activity</a>\n</div>\n<div class='el'>\n<a class='conversations ajax' href='/projects/{{permalink}}/conversations'>Conversations</a>\n</div>\n<div class='el'>\n<a class='tasks' href='/projects/{{permalink}}/task_lists'>Tasks</a>\n</div>\n{{#time_tracking}}\n<div class='el'>\n<a class='time ajax' href='/projects/{{permalink}}/time'>Time tracking</a>\n</div>\n{{/time_tracking}}\n<div class='el'>\n<a class='pages ajax' href='/projects/{{permalink}}/pages'>Pages</a>\n</div>\n<div class='el'>\n<a class='files ajax' href='/projects/{{permalink}}/uploads'>Files</a>\n</div>\n{{#can_admin}}\n<div class='el'>\n<a class='settings' href='/projects/{{permalink}}/settings'>Settings</a>\n</div>\n<div class='contained'>\n<div class='el'>\n<a class='general_settings ajax' href='/projects/{{permalink}}/settings'>\u4e00\u822c\u8a2d\u5b9a</a>\n</div>\n<div class='el'>\n<a class='deletion ajax' href='/projects/{{permalink}}/deletion'>\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u306e\u30a2\u30fc\u30ab\u30a4\u30d6/\u524a\u9664</a>\n</div>\n</div>\n{{/can_admin}}\n<div class='el'>\n<a class='people ajax' href='/projects/{{permalink}}/people'>People & Permissions</a>\n</div>\n</div>\n{{/projects}}\n{{#show_more}}\n<div class='el' id='show_all_projects'>\n<a class='more' href='/my_projects'>Show all projects...</a>\n</div>\n{{/show_more}}\n{{#new_project}}\n<div class='el'>\n<a class='more ajax' href='/projects/new'>+</a>\n</div>\n{{/new_project}}\n","organizations":"{{#organizations}}\n<div class='el'>\n<a class='project' href='/organizations/{{permalink}}'>{{name}}</a>\n</div>\n<div class='contained'>\n<div class='el'>\n<a class='ajax' href='/organizations/{{permalink}}/edit'>\u4e00\u822c\u8a2d\u5b9a</a>\n</div>\n<div class='el'>\n<a class='ajax' href='/organizations/{{permalink}}/projects'>\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u7ba1\u7406</a>\n</div>\n<div class='el'>\n<a class='ajax' href='/organizations/{{permalink}}/task_list_templates'>Task List Templates</a>\n</div>\n{{#can_admin}}\n<div class='el'>\n<a class='ajax' href='/organizations/{{permalink}}/memberships'>\u30e6\u30fc\u30b6\u30fc\u7ba1\u7406</a>\n</div>\n<div class='el'>\n<a href='/organizations/{{permalink}}/appearance'>\u5916\u89b3</a>\n</div>\n<div class='el'>\n<a class='ajax' href='/organizations/{{permalink}}/delete'>\u3053\u306e\u7d44\u7e54\u3092\u6d88\u53bb</a>\n</div>\n{{/can_admin}}\n</div>\n{{/organizations}}\n{{#no_community}}\n<div class='el'>\n<a class='more ajax' href='/organizations'>Manage organizations...</a>\n</div>\n{{/no_community}}\n"}});